import sys

def judge(a, b):
    if a == 1:
        if b == 1:
            return 'Draw'
        else:
            return 'Alice'
    elif b == 1:
        return 'Bob'
    else:
        if a > b:
            return 'Alice'
        elif a < b:
            return 'Bob'
        else:
            return 'Draw'

if __name__ == '__main__':
    a, b = map(int, input().split())
    print(judge(a, b))
